    super(props);
    this.tm30 = this.props.tm30;

    this.lcs = [];
    this.lhs = [];
    this.lcf = [];
    this.lcs_lhs_lcf = [];
    this.sample_count = [];
    this.atest = [];
    this.btest = [];
    this.aref = [];
    this.bref = [];
    this.da = [];
    this.db = [];
    this.pathxref = [];
    this.pathyref = [];
    this.pathxtest = [];
    this.pathytest = [];
