                        </i>{" "}
                      </Col>
                      <Col xs={6}>
                        <i>
                          b'<sub>ref,j</sub>
                        </i>
                      </Col>
                    </th>
                    <th colSpan="6">
                      Reference Coordinates <hr /> <Col xs={2}>da relative</Col>
                      <Col xs={2}>db relative</Col>
                      <Col xs={2}>path_x ref</Col>
                      <Col xs={2}>path_y ref</Col>
                      <Col xs={2}>path_x test</Col>
                      <Col xs={2}>path_y test</Col>
                    </th>
                  </tr>
                </thead>
                <tbody>
                  {this.lcs_lhs_lcf[0]}
