                  {this.lcs_lhs_lcf[13]}
                  {this.lcs_lhs_lcf[14]}
                  {this.lcs_lhs_lcf[15]}
                </tbody>
              </Table>
            </Card>
          </Row>
          <h2 align="center">
            Color Rendition of Color Evaluation Samples (CES)
