                      </i>
                    </Col>
                  </th>
                  <th colSpan={3}>
                    Reference Coordinates <hr />
                    <Col xs={4}>
                      <i>
                        J'
                        <sub>r,i</sub>
                      </i>{" "}
                    </Col>
                    <Col xs={4}>
                      <i>
                        a'<sub>r,i</sub>
                      </i>
                    </Col>
                    <Col xs={4}>
                      <i>
                        b'<sub>r,i</sub>
